import React from 'react';
import { Link } from 'react-router-dom';

const FloatingMenu = () => {
  return (
    <div className="fixed top-4 left-1/2 transform -translate-x-1/2 z-50">
      <div className="bg-slate-800/50 backdrop-blur-sm rounded-full shadow-lg px-6 py-3 flex items-center space-x-8 border border-slate-700/30">
        <Link 
          to="/" 
          className="text-gray-300 hover:text-indigo-400 transition-colors duration-200 font-medium"
        >
          Home
        </Link>
        <Link 
          to="/resume-verify" 
          className="text-gray-300 hover:text-purple-400 transition-colors duration-200 font-medium"
        >
          Resume & Verify
        </Link>
        <Link 
          to="/resume-analytics" 
          className="text-gray-300 hover:text-pink-400 transition-colors duration-200 font-medium"
        >
          Resume Analytics
        </Link>
      </div>
    </div>
  );
};

export default FloatingMenu;
